import React, { useEffect, useState } from "react";

const Api = () => {
  const [user, setUser] = useState([]);

  useEffect(()=>{
    fetch('https://dummyjson.com/products/').then((data)=>{
        data.json().then(result =>{
            console.log(result);
            setUser(result)
        })
    })
  })
  return (
    <>
      <table border="1px">
            <tr>
                <th>id</th>
                <th>title</th>
                <th>price</th>
                <th>brand</th>
            </tr>
            {
                user.map((item,index)=>
                <tr key={index}>
                    <td>{item.id}</td>
                    <td>{item.title }</td>
                    <td>{item.price}</td>
                    <td>{item.brand}</td>
                </tr>
                )
            }
      </table>
    </>
  );
};

export default Api;
